            <div className="row bg-light fixed-top px-5 py-2">
                <div className="col-12 d-flex align-items-center ms-2">
                    <SidebarData />
                    <div className="ms-auto">
                    <Link to="/" className="mx-3"> Inicio </Link>
                    <Link to="/Torneos" className="mx-3"> Torneos </Link>
                    <Link to="/Ligas" className="mx-3"> Ligas </Link>
                    <Link to="/RealMadrid" className="mx-3"> Partidos Real Madrid </Link>
                    <Link to="/MundialQatar" className="mx-3"> Mundial De Qatar </Link>
                    <Link to="/Contacto" className="mx-3"> Contacto </Link>                                      

                </div>
                </div>        

            </div>                           

        )
    }
}
